Débit descendant | Jusqu’à 2,5 Gbps | Jusqu’à 10 Gbps
Débit montant | Jusqu’à 1,25 Gbps | Jusqu’à 10 Gbps

Le XGS-PON représente l’évolution naturelle de la fibre, préparant Algérie Télécom à offrir des ultra hauts débits. 5. Quels clients peuvent acheter un ONT XGS-PON Wi-Fi 6 ? Seuls Les clients:

- Disposant d’un abonnement IDOOM FIBRE avec un débit minimum de 1 Gbps et plus ;
- Qu’il soit raccordé sur une carte compatible XGS-PON, peuvent acquérir ce type d’équipement ;
- Zones équipés par Huawei et FiberHome ;
- Test d’éligibilité concluant sur le site. La vérification de l’éligibilité des clients s’effectue sur le site officiel d’Algérie Télécom.

Quel est l’objectif de la plateforme ? L’objectif principal est l’accompagnement des élèves et leurs parents, surtout lors de ce dernier trimestre de l’année scolaire. 3. Quels sont les caractéristiques de la plateforme MOALIM ? - La première plateforme de soutien scolaire intelligente, offrant un contenu personnalisé selon le profil de chaque élève, basée sur le e-learning et l’intelligence artificielle ;
- Permet d’offrir 12 activités adaptatives, basées sur :
  - Des exercices et des quizz ;
  - L’évaluation et l’entrainement ciblé ;
  - L’approche par compétence ; et
  - L’apprentissage par l’erreur. - Contribution de plusieurs collaborateurs :
  - 50 Enseignants ;
  - 10 intervenants pour le développement des supports pédagogiques.

Comment se fera la livraison des produits achetés ? La livraison des produits sera assurée par un organisme spécialisé. 5. Quels sont les délais de livraison après validation de la commande ? Le client sera systématiquement renseigné sur les délais et les frais de livraison, lors de chaque confirmation de commande. Il est à noter que ces délais peuvent varier en fonction de la société et de la destination. 6. Est-ce que la livraison est payante ? La livraison est payante. Il est à noter que le prix de la livraison varie en fonction de la société et de la destination. 7. Qui contacter en cas de problème ? En cas de problème de produit livré (défectueux ou non conforme), le client doit se rendre à l’agence commerciale la plus proche, dans un délai maximum de 96 heures (ouvrables), suivant la réception du produit. 7-1 Est-ce que le client peut formuler une demande de remboursement ? et comment ? Oui, le client peut formuler une demande de remboursement via la boutique en ligne. 7-1-1 Cas produit non livré dans les délais :

Le client formule une demande de remboursement via la boutique en ligne, qui sera traitée par la Cellule TME-R (DMI), dans le cas où le délai n’a pas été dépassé, aucun remboursement ne sera effectué. 7-1-2 Cas produit livré (défectueux ou non conforme) :

Le client se présente à l’ACTEL de son rattachement ou la plus proche pour la restitution du produit au cours des 96h (ouvrables), à compter de la date de livraison, faute de quoi, sa demande de remboursement sera rejetée. 7-2 Quand est-ce que la demande de remboursement est jugée recevable ? Une demande de remboursement est jugée recevable dans les cas suivants :
- Délai de livraison dépassé ;
- Produit défectueux ;
- Produit non conforme. 8. Qui prend en charge la réclamation de (remboursement et remplacement) au niveau de l’actel ? La réclamation sera prise en charge par le Superviseur FO de l’actel. 9. Quel est le délai pour se faire rembourser ? Le délai de remboursement ne doit pas dépasser 15 jours à compter de la date de la demande de remboursement. 10. Quelles sont les conditions de recevabilité de ma demande de remplacement ? Une demande de remplacement est jugée recevable dans les cas suivants

Comment fonctionne le système de bonus ? Les clients reçoivent des jours supplémentaires en fonction de la durée de leurs paiements. NB :
- Les avantages actuels liés au paiement électronique d’internet filaire de idoom ADSL, VDSL et Idoom Fibre sont remplacés par cette offre. Cependant, les bonus pour le paiement électronique des factures téléphoniques et des abonnements Idoom 4G LTE restent inchangés. - Le nombre des opérations n'est pas limité, à condition de respecter le bonus attribué pour chaque durée rechargée, comme indiqué dans le tableau au-dessus. 5. Est-ce que le bonus est cumulable ? Oui, le bonus est cumulable entre les opérations de rechargement. 6. Les clients résidentiels locataires et conventionnés sont-ils également éligibles aux avantages de l'offre de paiement électronique ? En effet, les clients résidentiels locataires et conventionnés sont éligibles aux avantages liés au paiement électronique. 7. Quels sont les moyens de paiement électronique concernés par cette offre ? Algérie Télécom propose plusieurs plateformes de paiement électronique (via les cartes Eddahabia et CIB) des offres internet, résumés comme suit :
- Espace client d’Algérie Télécom : https://client.algérietelecom.dz, avec la carte Edahabia ou CIB ;
- L’application My Idoom, téléchargeable via Google Play, App Store et Huawei AppGallery ;
- L’application Algérie Télécom (https://paiement.at.dz/) ;
- L’application Baridimob ;
- L’application BNA Wimpay ;
- Paiement via les terminaux de paiement électronique (TPE) au sein des agences commerciales et points de présence. 8. Quels sont les objectifs principaux de cette offre pour Algérie Télécom ? L’offre vise à :
- Digitaliser le parcours client ;
- Améliorer l’expérience client. 9. Quelle est la valeur ajoutée pour le client ? En optant pour le paiement électronique, le client bénéficie de jours de connexion gratuits tout en profitant d’une expérience rapide, sécurisée et moderne. C'est une solution pratique qui répond aux besoins des clients connectés. 10. Comment les clients peuvent-ils profiter de cette offre ? Les clients n'ont qu'à effectuer des paiements via un moyen de paiement électronique. Les bonus sont automatiquement appliqués en fonction de la durée rechargée.
